import classes from "./Button.module.css"
const Button=(props)=>{
    return(
        <button className={classes.button-50}
        type={props.type || 'button-50'}
        onClick={props.onClick}>
           {props.children}
        </button>// the onclick is to make understand react if we use onclick then onclick should activate same as we make that understand classname
    )
}
export default Button
